import * as React from 'react';
import { View, Text, StyleSheet, Platform, TouchableOpacity, TextInput, StatusBar } from 'react-native';
import { ScrollView } from 'react-native-gesture-handler';
import { color } from 'react-native-reanimated';
import { SafeAreaProvider, SafeAreaView } from 'react-native-safe-area-context';
import {Feather} from '@expo/vector-icons'


const Login = () => {
    return (
        <SafeAreaProvider style={{paddingHorizontal : 20, flex: 1, backgroundColor: '#000'}}>
            <ScrollView showVerticalScrollIndicator={false}>
                <View style={{flexDirection: "row", marginTop: 40}}>
                    <Text style={{fontWeight: "bold", fontSize: 22, color: '#fff'}}>JET</Text>
                    <Text style={{fontWeight: "bold", fontSize: 22, color: '#333'}}>SPEED</Text>
                </View>
                <View style={{marginTop: 70}}>
                    <Text style={{fontSize: 27, fontWeight: 'bold', color: '#fff'}}>Welcome Back,</Text>
                    <Text style={{fontSize: 19, fontWeight: 'bold', color: '#333'}}>Login to continue</Text>
                </View>
                <View style={{marginTop: 20}}>
                    <View style={{flexDirection: 'row', marginTop: 20}}>
                        <Feather
                            name="user"
                            color={'#fff'}
                            size={20}
                            style={{position: 'absolute'}}
                        />
                        <TextInput
                            placeholder="Email"
                            style={{
                                color: '#fff', 
                                paddingLeft: 30, 
                                borderBottomWidth: 0.5, 
                                flex: 1, 
                                borderColor: '#333',
                                fontSize: 18
                            }}
                            autoCapitalize="none"
                        />
                    </View>
                    <View style={{flexDirection: 'row', marginTop: 20}}>
                        <Feather
                            name="lock"
                            color={'#fff'}
                            size={20}
                            style={{position: 'absolute'}}
                        />
                        <TextInput
                            placeholder="Password"
                            style={{
                                color: '#fff', 
                                paddingLeft: 30, 
                                borderBottomWidth: 0.5, 
                                flex: 1, 
                                borderColor: '#333',
                                fontSize: 18
                            }}
                            secureTextEntry={true}
                            autoCapitalize="none"
                        />
                    </View>
                    <View style={{backgroundColor: '#fff', height: 50, marginTop: 50, justifyContent: 'center', alignItems: 'center', borderRadius: 5}}>
                        <Text style={{fontSize: 18, color: '#000', fontWeight: 'bold'}}>
                            LOGIN
                        </Text>
                    </View>
                    <View style={{marginVertical: 20, flexDirection: 'row', justifyContent: 'center', alignItems: 'center'}}>
                            <View style={{height: 1, width: 30, backgroundColor: '#333'}}>
                                
                            </View>
                    </View>
                </View>
            </ScrollView>
        </SafeAreaProvider>
    );
}

export default Login;
